import React from "react";
import { NavLink } from "react-router-dom";
import "./NavBar.css";
import Dropdown from "react-bootstrap/Dropdown"

export default function NavBar() {
  return (
    <div className="nav-bar">
      <NavLink to="/homeview" className="meme-book">
        Meme <br />
        <span
          style={{
            color: "black",
            fontSize: "50px",
            textShadow: "0 0 2px white",
          }}
        >
          Book
        </span>
      </NavLink>
      {/* <img src="./images/upload.png" alt="upload" className="meme-upload"/> */}
      <button
        to="/homeview/upload"
        className="meme-upload"
        title="Upload Meme"
      ></button>
      <button to="/homeview/create" className="meme-create"></button>
      {/* <button to="/homeview/profile" className="meme-profile"></button> */}
      <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic" className="meme-profile">
        </Dropdown.Toggle>

        <Dropdown.Menu>
          <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
          <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
          <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
    </div>
  );
}
